import React from "react";
import Frame3619 from "../Frame3619";
import UserUser from "../UserUser";
import "./Frame1954.css";

function Frame1954(props) {
  const { text3, text2, frame3619Props, userUserProps } = props;

  return (
    <div className="frame-1954">
      <div className="flex-row2">
        <h1 className="text-3 ibmplexsans-semi-bold-quarter-spanish-white-32px">{text3}</h1>
        <div className="frame-3624">
          <Frame3619 editSearchProps={frame3619Props.editSearchProps} />
          <div className="frame-3622 border-0-5px-quarter-spanish-white">
            <UserUser userUser={userUserProps.userUser} />
            <div className="text-2 valign-text-middle ibmplexsans-semi-bold-quarter-spanish-white-16px">{text2}</div>
          </div>
        </div>
      </div>
      <div className="rectangle-6"></div>
    </div>
  );
}

export default Frame1954;
